                                                    SBCB.HorizontalAlignment = Element.ALIGN_LEFT;
                                                    SBCB.FixedHeight = 15f;
                                                    SBCB.Border = iTextSharp.text.Rectangle.RIGHT_BORDER;
                                                    table.AddCell(SBCB);
                                                }
                                                else
                                                {
                                                    PdfPCell SBCB = new PdfPCell(new Phrase("_______", TableFont));
                                                    SBCB.HorizontalAlignment = Element.ALIGN_LEFT;
                                                    SBCB.FixedHeight = 15f;
                                                    SBCB.Border = iTextSharp.text.Rectangle.RIGHT_BORDER;
                                                    table.AddCell(SBCB);
                                                }
                                            }
                                        }

                                    }
                                }
                                int result = 0;
                                if (rbAllTasks.Checked == true)
                                    result = SelCount % 2;
                                else
                                    result = SeltaskCount % 2;
                                if (result != 0)
                                {
                                    PdfPCell extra = new PdfPCell(new Phrase("", TableFont));
                                    extra.HorizontalAlignment = Element.ALIGN_LEFT;
                                    extra.Colspan = 5;
                                    extra.Border = iTextSharp.text.Rectangle.LEFT_BORDER + iTextSharp.text.Rectangle.RIGHT_BORDER;
                                    table.AddCell(extra);
                                }

                                PdfPCell Space = new PdfPCell(new Phrase("", TableFont));
                                Space.HorizontalAlignment = Element.ALIGN_LEFT;
                                Space.Colspan = 10;
                                Space.Border = iTextSharp.text.Rectangle.BOTTOM_BORDER + iTextSharp.text.Rectangle.LEFT_BORDER + iTextSharp.text.Rectangle.RIGHT_BORDER;
                                table.AddCell(Space);

                            }
                        }

                            if (table.Rows.Count > 0)
                            {
                                if (RepEntity.AppNo != PrivApp)
                                {
                                    document.Add(table);
                                    table.DeleteBodyRows();
                                    PrivApp = RepEntity.AppNo.Trim();
                                    document.NewPage();
                                }
                            }
                        }
                    
                }
                else
                {
                    cb.BeginText();
                    cb.SetFontAndSize(bfTimes, 18);
                    cb.SetColorFill(BaseColor.RED);
                    cb.ShowTextAligned(Element.ALIGN_LEFT, "No records found", 150, 500, 0);
                    cb.EndText();
                }
               

            }
            catch (Exception ex) { document.Add(new Paragraph("Aborted due to Exception............................................... ")); }
        }


