        private void GetFund(string Agy,string Dept, string Prog, string Year,string App_No)
        {
            propFund = string.Empty;
            propAttnDate = string.Empty;
            CaseEnrlEntity Search_Entity = new CaseEnrlEntity(true);
            Search_Entity.Agy = Agy;
            Search_Entity.Dept = Dept;
            Search_Entity.Prog = Prog;
            Search_Entity.Year = Year;
            Search_Entity.App = App_No;
            Search_Entity.Rec_Type = "H";
            Search_Entity.Status = "E";
            Search_Entity.Enrl_Status_Not_Equalto = "T";
            App_Mult_Fund_List = _model.EnrollData.Browse_CASEENRL_ForApp_InMultFunds(Search_Entity, "Browse");
            if (App_Mult_Fund_List.Count > 0)
            {
                if (App_Mult_Fund_List.Count == 1)
                {
                    propFund = App_Mult_Fund_List[0].FundHie.ToString().Trim();
                    //propAttnDate = ChldAttnDB.GetChldAttnDate(BaseForm.BaseAgency, BaseForm.BaseDept, BaseForm.BaseProg, BaseForm.BaseYear, BaseForm.BaseApplicationNo, App_Mult_Fund_List[0].Site, App_Mult_Fund_List[0].Room, App_Mult_Fund_List[0].AMPM, App_Mult_Fund_List[0].FundHie, string.Empty);
                }
                else
                {
                    CaseEnrlEntity caseEnrlFundFilter = App_Mult_Fund_List.Find(u => u.FundHie.Trim() == "HS");
                    if (caseEnrlFundFilter != null)
                    {
                        propFund = caseEnrlFundFilter.FundHie;
                        //propAttnDate = ChldAttnDB.GetChldAttnDate(BaseForm.BaseAgency, BaseForm.BaseDept, BaseForm.BaseProg, BaseForm.BaseYear, BaseForm.BaseApplicationNo, caseEnrlFundFilter.Site, caseEnrlFundFilter.Room, caseEnrlFundFilter.AMPM, caseEnrlFundFilter.FundHie, string.Empty);
                    }
                    else
                    {
                        propFund = App_Mult_Fund_List[0].FundHie.ToString().Trim();
                        //propAttnDate = ChldAttnDB.GetChldAttnDate(BaseForm.BaseAgency, BaseForm.BaseDept, BaseForm.BaseProg, BaseForm.BaseYear, BaseForm.BaseApplicationNo, App_Mult_Fund_List[0].Site, App_Mult_Fund_List[0].Room, App_Mult_Fund_List[0].AMPM, App_Mult_Fund_List[0].FundHie, string.Empty);
                    }
                }
            }
            else
            {

                ChldMstEntity chldmstentity = _model.ChldMstData.GetChldMstDetails(Agy, Dept, Prog, (!string.IsNullOrEmpty(Year.Trim()) ? Year : "    "), App_No, string.Empty);
                if (chldmstentity != null)
                {
                    propFund = chldmstentity.FundSource.ToString().Trim();
                    if (propFund == string.Empty)
                    {
                        CaseVerEntity caseverEntity = _model.CaseMstData.GetCaseveradpynd(Agy, Dept, Prog, (!string.IsNullOrEmpty(Year.Trim()) ? Year : "    "), App_No, string.Empty, string.Empty);
                        if (caseverEntity != null)
                        {
                            propFund = caseverEntity.FundSource.ToString().Trim();
                        }
                    }

                }
                else
                {

                    CaseVerEntity caseverEntity = _model.CaseMstData.GetCaseveradpynd(Agy, Dept, Prog, (!string.IsNullOrEmpty(Year.Trim()) ? Year : "    "), App_No, string.Empty, string.Empty);
                    if (caseverEntity != null)
                    {
                        propFund = caseverEntity.FundSource.ToString().Trim();
                    }
                    else
                    {
                        
                    }
                }
            }
            
        }

        private string FillSBCDDetails(string strApplicationNo, string strIntakeDate, string strDateOfBirth, string strAttnDate, string strcomponents, string strTask, string Status,string Site,string room,string ampm)
        {
            string strDate = string.Empty; string Year = string.Empty;
            if (!string.IsNullOrEmpty(propFund.Trim()))
            {
                if (CmbYear.Visible == true)
                    Year = ((Captain.Common.Utilities.ListItem)CmbYear.SelectedItem).Text.ToString().Trim();
                if (propchldtrackRList.Count > 0)
                {
                    List<ChldTrckREntity> chldtrackRList = propchldtrackRList.FindAll(u => u.TASK.Trim().Equals(strTask.Trim()) && u.FUND.Trim().Equals(propFund.Trim()));
                    if (chldtrackRList.Count > 0)
                    {
                        foreach (ChldTrckREntity chldtrackitem in chldtrackRList)
                        {
