        private string FillSBCDNextDetails(string strDateOfBirth, string strAttnDate, string strTask, string Status, string Site, string room, string ampm, string strApplicationNo)
        {
            string strDate = string.Empty;
            string Year=string.Empty;
            if (CmbYear.Visible == true)
                Year = ((Captain.Common.Utilities.ListItem)CmbYear.SelectedItem).Text.ToString().Trim();

            ChldTrckREntity chldtrackitem = propchldtrackRList.Find(u => u.TASK == strTask && u.FUND == propFund); // _model.ChldTrckData.GetCasetrckrDetails(string.Empty, string.Empty, string.Empty, "0000", propTask, string.Empty);
            if (chldtrackitem != null)
            {
                if (chldtrackitem.NXTACTION.Trim() == "Y" && chldtrackitem.INTAKEENTRY.Trim().Equals("E") && Status == "E")
                {
                    if (!string.IsNullOrEmpty(chldtrackitem.NEXTDAYS))
                    {
                        strAttnDate = DatabaseLayer.ChldAttnDB.GetChldAttnDate(Agency, Depart, Program, Year, strApplicationNo, Site, room, ampm, propFund, string.Empty);
                        if (Convert.ToInt32(chldtrackitem.NEXTDAYS) >= 0)
                        {
                            if(!string.IsNullOrEmpty(strAttnDate.Trim()))
                            strDate = Convert.ToDateTime(strAttnDate).AddDays(Convert.ToInt32(chldtrackitem.NEXTDAYS)).ToString();
                        }
                    }
                }
            }

            return strDate;
        }

